export declare function isString(val: unknown): val is string | String;
export declare function isntString<T>(val: T): val is Exclude<T, string | String>;
export declare function isStringPrimitive(val: unknown): val is string;
export declare function isntStringPrimitive<T>(val: T): val is Exclude<T, string>;
export declare function isStringObject(val: unknown): val is String;
export declare function isntStringObject<T>(val: T): val is Exclude<T, String>;
